import { TextSection } from "./TextSection"



const Section = ({className, classText, titleClass, title, parag, classParag, linkCont, classLink, img, classImgCont, hasText,classImgCont2 }) => {
  return(
    hasText? <section className={className}>
                <TextSection 
                  className={classText} 
                  titleClass={titleClass} 
                  title={title}
                  parag={parag}
                  classParag={classParag}
                  linkCont={linkCont}
                  classLink={classLink}
                />
                <div className={classImgCont}>
                  <img 
                  src={img}
                  alt='img sunnyside'
                  />
                </div>
             </section>: <section className={className}>
                            <div className={classImgCont}>
                              <img 
                              src={img2}
                              alt='img sunnyside'
                              />
                            </div>
                            <div className={classImgCont2}>
                              <img 
                              src={img}
                              alt='img sunnyside'
                              />
                            </div>
                        </section>
  )
}
export default Section
